import React from "react";

import "./App.css";

import logo from "./assets/logo.svg";

import Routes from "./routes";

function App() {
  return (
    <>
      <div className="container">
        <img src={logo} alt="AirCnC" />
      </div>
      <Routes />
    </>
  );
}

export default App;
